import Sliderbrand from './sliderbrand';

import ParticlesComponent from './colisprive/particles';
import Footer from './colisprive/footer';
import { BrowserRouter, Route, Router, Routes } from 'react-router-dom';

function App() {
  return (<>

<Header/>
  <Sliderimage/>
  <Result/>
  <Sulution/>
  <Card/>
  <Protection/>
  <Sliderbrand/> 

     <ParticlesComponent />

  <Footer/>


  {/* <Test/> */}
  </> 
    )
}

export default App;
